// src/components/FrontPage.js
import React from "react";
import { useNavigate } from "react-router-dom";
import "./FrontPage.css";

function FrontPage() {
  const navigate = useNavigate();

  return (
    <div className="front-page">
      {/* Header with Logo */}
      <header className="header">
        <img src="/logo.png" alt="CSECU Logo" className="logo" />
      </header>

      {/* Main Content */}
      <main className="main-content">
        {/* Welcome Message */}
        <h1 className="welcome-message">
          Welcome to the CSECU Family!
        </h1>

        {/* Description */}
        <p className="description">
          The Department of Computer Science & Engineering (CSE) at the University of Chittagong launched its undergraduate major programme in 2001 and its postgraduate programme in 2010. The department is home to 22 faculty members, 300 undergraduate students, and 100 MSc students.
        </p>

        {/* Buttons */}
        <div className="button-group">
          <button className="btn primary" onClick={() => navigate("/signup")}>
            Sign Up
          </button>
          <button className="btn secondary" onClick={() => navigate("/login")}>
            Login
          </button>
        </div>
      </main>
    </div>
  );
}

export default FrontPage;
